import React from 'react';
import './App.css';
import Headers from './Headers'
import Article from './Article'
import Footer from './Footer'




function App (props) {
  return (
    <div className="container-fluid">
      <nav>
        <a href="#">Home</a>
        <a href="#">Dicas</a>
        <a href="#">Feedback</a>

        </nav>

      </div>,


    <div>
            {/* <Headers /> */}
            <Article />
            <Footer />
          </div>
    
  );
};


export default App;
